import React, { Component } from 'react';
import { editUser } from '../../actions/index'
import { connect } from 'react-redux'

class ProfileEdit extends Component {

  state = {
    first_name: '',
    last_name: '',
    email: '',
    password: ''
  }

  handleChange = (event) => {
    this.setState({ [event.target.name]: event.target.value })
  }

  handleSubmit = (event) => {
    event.preventDefault()

    if (this.state.first_name && this.state.last_name && this.state.email && this.state.password) {

      this.props.editUser(this.state)
      event.target.reset()
    } else {
      alert('Please fill out all information.');
    }
  }

  render() {
    return (
      <div>
        <form onSubmit={this.handleSubmit}>
          <img src='' alt=''></img>
          <div>
            <label> First Name: </label>
            <input type="text" name='first_name' value={this.state.first_name} onChange={this.handleChange}></input>

            <label> Last Name: </label>
            <input type="text" name='last_name' value={this.state.last_name} onChange={this.handleChange}></input>

            <label> Email: </label>
            <input type="text" name='email' value={this.state.email}></input>

            <label> Password: </label>
            <input type="text" name='password'></input>

            <button> Save </button>
          </div>
        </form>
      </div>
    );
  }
}

const mapDispatchToProps = state => {
  return {
    user: state.user
  }
}

export default connect(null, mapDispatchToProps)(ProfileEdit)
